import styled from 'styled-components'

export const Header = styled.div`
    display : flex;
    flex-direction : column;


    .headerNav{
        display : flex;
        flex-direction : row;


        button{
            border: none;
            background-color : transparent;
            outline: none;
        }

    }


`
